import React, { Component } from 'react';

import './Footer.css'

class Footer extends Component {
    render() {
        return (
            <div className={footer}>
                <p>Created by <a href="https://github.com/jialin-wu-02"> Jialin Wu </a></p>
            </div>
        )
    }
}

export default Footer;
